webpackJsonp([0xb766a966f86a],{590:function(n,a){n.exports={data:{site:{siteMetadata:{title:"Dustin Schau - Blog",author:"Dustin Schau"}},markdownRemark:{id:"/Users/okwen/www/gatsbyblog/content/blog/102_2018-09-07/index.md absPath of file >>> MarkdownRemark",html:'<h3 id="盒模型"><a href="#%E7%9B%92%E6%A8%A1%E5%9E%8B" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>盒模型</h3>\n<ul>\n<li>\n<p>盒模型<br>\n每个元素都被描述成矩形盒子，这些矩形盒子通过一个模型来描述其占用空间</p>\n</li>\n<li>\n<p>图示\n\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 72.4669603524229%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="personalcode"\n        title=""\n        src="/static/001-0a98a4e2a685554e74ec07cdba5fa8bc-83a8b.png"\n        srcset="/static/001-0a98a4e2a685554e74ec07cdba5fa8bc-8992e.png 163w,\n/static/001-0a98a4e2a685554e74ec07cdba5fa8bc-ae0a7.png 325w,\n/static/001-0a98a4e2a685554e74ec07cdba5fa8bc-83a8b.png 650w,\n/static/001-0a98a4e2a685554e74ec07cdba5fa8bc-c6bce.png 908w"\n        sizes="(max-width: 650px) 100vw, 650px"\n      />\n    </span>\n  </span>\n  </p>\n</li>\n<li>\n<p>说明</p>\n<ul>\n<li>内容框(content)是实际的内容</li>\n<li>直接包围内容的是内边距(padding)。内边距呈现了元素的背景。</li>\n<li>内边距的边缘是边框(border)。</li>\n<li>边框以外是外边距(margin)，外边距默认是透明的，因此不会遮挡其后的任何元素。</li>\n<li>width 和 height 指的是内容框(content)的宽度和高度</li>\n</ul>\n</li>\n</ul>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 335px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 129.55223880597012%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="personalcode"\n        title=""\n        src="/static/personalcode-e31e640cabbccf9fc3e88c38c6d89055-a05a7.png"\n        srcset="/static/personalcode-e31e640cabbccf9fc3e88c38c6d89055-3788e.png 163w,\n/static/personalcode-e31e640cabbccf9fc3e88c38c6d89055-d32ed.png 325w,\n/static/personalcode-e31e640cabbccf9fc3e88c38c6d89055-a05a7.png 335w"\n        sizes="(max-width: 335px) 100vw, 335px"\n      />\n    </span>\n  </span>\n  </p>',excerpt:"盒模型 盒模型 每个元素都被描述成矩形盒子，这些矩形盒子通过一个模型来描述其占用空间 图示\n 说明 内容框(content)是实际的内容 直接包围内容的是内边距(padding)。内边距呈现了元素的背景。 内边距的边缘是边框(border)。 边框以外是外边距(margin…",timeToRead:1,frontmatter:{date:"2018年09月07日",rawDate:"2018-09-07T16:00:00.000Z",excerpt:"&nbsp",title:"102期 盒模型",image:{childImageSharp:{resize:{src:"/static/preview-5f723809bab3539ca2b93d3ae17465c7-2c40b.png"}}}}}},pathContext:{prev:{excerpt:"颜色 别名 \n使用颜色的英文名 RGB \n红绿蓝颜色值 十六进制表示法 \n十六进制值使用三个双位数来编写，并以 # 符号开头。",html:'<h3 id="颜色"><a href="#%E9%A2%9C%E8%89%B2" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>颜色</h3>\n<ul>\n<li>\n<p><strong>别名</strong>\n使用颜色的英文名</p>\n<div class="gatsby-highlight">\n      <pre class="language-css"><code><span class="token selector">p</span> <span class="token punctuation">{</span>\n<span class="token property">color</span><span class="token punctuation">:</span> blue<span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n</li>\n<li>\n<p><strong>RGB</strong>\n红绿蓝颜色值</p>\n<div class="gatsby-highlight">\n      <pre class="language-css"><code><span class="token selector">p</span> <span class="token punctuation">{</span>\n<span class="token property">color</span><span class="token punctuation">:</span><span class="token function">rgb</span><span class="token punctuation">(</span>255,0,0<span class="token punctuation">)</span><span class="token punctuation">;</span><span class="token comment">/*顺序依次表示红绿蓝的程度*/</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n</li>\n<li>\n<p><strong>十六进制表示法</strong>\n十六进制值使用三个双位数来编写，并以 # 符号开头。</p>\n<div class="gatsby-highlight">\n      <pre class="language-css"><code><span class="token selector">.hex</span> <span class="token punctuation">{</span>\n<span class="token property">color</span><span class="token punctuation">:</span> #0e7ab9<span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n</li>\n</ul>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 335px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 129.55223880597012%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="personalcode"\n        title=""\n        src="/static/personalcode-e31e640cabbccf9fc3e88c38c6d89055-a05a7.png"\n        srcset="/static/personalcode-e31e640cabbccf9fc3e88c38c6d89055-3788e.png 163w,\n/static/personalcode-e31e640cabbccf9fc3e88c38c6d89055-d32ed.png 325w,\n/static/personalcode-e31e640cabbccf9fc3e88c38c6d89055-a05a7.png 335w"\n        sizes="(max-width: 335px) 100vw, 335px"\n      />\n    </span>\n  </span>\n  </p>',id:"/Users/okwen/www/gatsbyblog/content/blog/101_2018-09-07/index.md absPath of file >>> MarkdownRemark",timeToRead:1,fields:{slug:"/videos/101"},frontmatter:{date:"September 07, 2018",draft:!1,title:"101期 使用颜色"}},next:{excerpt:"内边距 概念 使用padding 属性定义元素边框与元素内容之间的空白区域 padding 基本属性 padding 属性接受长度值或百分比值，但不允许使用负值。 如果您希望所有 h1 元素的各边都有 10 像素的内边距，只需要这样：   可以按照上、右、下、左的顺序分别设置各边的内边距，各边均可以使用不同的单位或百分比值 单边内边距属性 通过使用下面四个单独的属性，分别设置上、右、下、左内边距 内边距的百分比数值    百分数值是相对于其父元素的 width 计算的 如果父元素的 width…",html:'<h3 id="内边距"><a href="#%E5%86%85%E8%BE%B9%E8%B7%9D" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>内边距</h3>\n<ul>\n<li>\n<p><strong>概念</strong><br>\n使用padding 属性定义元素边框与元素内容之间的空白区域</p>\n</li>\n<li>\n<p><strong>padding 基本属性</strong><br>\npadding 属性接受长度值或百分比值，但不允许使用负值。<br>\n如果您希望所有 h1 元素的各边都有 10 像素的内边距，只需要这样：  </p>\n<div class="gatsby-highlight">\n      <pre class="language-css"><code><span class="token selector">h1</span> <span class="token punctuation">{</span><span class="token property">padding</span><span class="token punctuation">:</span> 10px<span class="token punctuation">;</span><span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<p>可以按照上、右、下、左的顺序分别设置各边的内边距，各边均可以使用不同的单位或百分比值</p>\n<div class="gatsby-highlight">\n      <pre class="language-css"><code><span class="token selector">h1</span> <span class="token punctuation">{</span><span class="token property">padding</span><span class="token punctuation">:</span> 10px 0.25em 2ex 20%<span class="token punctuation">;</span><span class="token punctuation">}</span>\n</code></pre>\n      </div>\n</li>\n<li>\n<p><strong>单边内边距属性</strong><br>\n通过使用下面四个单独的属性，分别设置上、右、下、左内边距</p>\n<div class="gatsby-highlight">\n      <pre class="language-css"><code><span class="token selector">h1</span> <span class="token punctuation">{</span>\n<span class="token property">padding-top</span><span class="token punctuation">:</span> 10px<span class="token punctuation">;</span> <span class="token comment">/*上内边距*/</span>\n<span class="token property">padding-right</span><span class="token punctuation">:</span> 0.25em<span class="token punctuation">;</span> <span class="token comment">/*右内边距*/</span>\n<span class="token property">padding-bottom</span><span class="token punctuation">:</span> 2ex<span class="token punctuation">;</span> <span class="token comment">/*下内边距*/</span>\n<span class="token property">padding-left</span><span class="token punctuation">:</span> 20%<span class="token punctuation">;</span> <span class="token comment">/*左内边距*/</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n</li>\n<li>\n<p><strong>内边距的百分比数值</strong>  </p>\n<ul>\n<li>百分数值是相对于其父元素的 width 计算的</li>\n<li>\n<p>如果父元素的 width 改变，它们也会改变</p>\n<div class="gatsby-highlight">\n      <pre class="language-css"><code><span class="token selector">p</span> <span class="token punctuation">{</span>\n<span class="token property">padding</span><span class="token punctuation">:</span> 10%<span class="token punctuation">;</span> <span class="token comment">/*段落的内边距设置为父元素 width 的 10%*/</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<p>如果一个段落的父元素是 div 元素，那么它的内边距要根据 div 的 width 计算  </p>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>div</span><span class="token style-attr language-css"><span class="token attr-name"> <span class="token attr-name">style</span></span><span class="token punctuation">="</span><span class="token attr-value"><span class="token property">width</span><span class="token punctuation">:</span> 200px<span class="token punctuation">;</span></span><span class="token punctuation">"</span></span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>p</span><span class="token punctuation">></span></span>This paragragh is contained within a DIV that has a width of 200 pixels.<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>p</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>div</span><span class="token punctuation">></span></span> \n</code></pre>\n      </div>\n</li>\n</ul>\n</li>\n</ul>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 335px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 129.55223880597012%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="personalcode"\n        title=""\n        src="/static/personalcode-e31e640cabbccf9fc3e88c38c6d89055-a05a7.png"\n        srcset="/static/personalcode-e31e640cabbccf9fc3e88c38c6d89055-3788e.png 163w,\n/static/personalcode-e31e640cabbccf9fc3e88c38c6d89055-d32ed.png 325w,\n/static/personalcode-e31e640cabbccf9fc3e88c38c6d89055-a05a7.png 335w"\n        sizes="(max-width: 335px) 100vw, 335px"\n      />\n    </span>\n  </span>\n  </p>',id:"/Users/okwen/www/gatsbyblog/content/blog/103_2018-09-08/index.md absPath of file >>> MarkdownRemark",timeToRead:1,fields:{slug:"/videos/103"},frontmatter:{date:"September 10, 2018",draft:!1,title:"103期 内边距"}},slug:"/videos/102"}}}});
